create table t_entity_name
(
    id               varchar(36)  not null
        primary key,
    api              varchar(255) null,
    name             varchar(255) null,
    path             varchar(255) null,
    sort_code        varchar(255) null,
    type             varchar(255) null,
    rel_entity       varchar(255) null,
    form_model_code  varchar(255) null,
    table_model_code varchar(255) null,
    app_name         varchar(255) null
);

